package main

import (
	"container/list"
	"fmt"
)

func minJumps(arr []int) int {
	value2idx := GetNextPos(arr)
	// fmt.Println(value2idx)
	return BFS1345(arr, value2idx)
}

func BFS1345(arr []int, value2idx map[int][]int) int {
	// BFS
	queue := list.New()
	queue.PushBack(0)
	visited := map[int]bool{}
	visited[0] = true
	res := 0
	for queue.Len() > 0 {
		fmt.Println(res)
		size := queue.Len()
		for i := 0; i < size; i++ {
			idxP := queue.Front()
			queue.Remove(idxP)
			idx := idxP.Value.(int)
			if idx == len(arr)-1 {
				return res
			}
			value := arr[idx]
			// next
			nextArr := CopySlice(value2idx[value])
			if idx > 0 {
				nextArr = append(nextArr, idx-1)
			}
			if idx < len(arr)-1 {
				nextArr = append(nextArr, idx+1)
			}
			// fmt.Println(nextArr)
			for _, nextIdx := range nextArr {
				fmt.Println(nextIdx)
				if _, ok := visited[nextIdx]; !ok {
					queue.PushBack(nextIdx)
					visited[nextIdx] = true
				}
			}
			// for array [7777777777777777777777777777777777777777777777, 1]
			// though we do not push idx of duplicate value into queue, iteration needs time
			// we need to remove key from map as soon as possible
			delete(value2idx, value)
		}
		res++
	}
	return -1
}

func GetNextPos(arr []int) map[int][]int {
	value2idx := map[int][]int{}
	for i := range arr {
		value := arr[i]
		// No need to initialize
		// if _, ok := value2idx[value]; !ok {
		// 	value2idx[value] = []int{}
		// }
		value2idx[value] = append(value2idx[value], i)
	}
	return value2idx
}

func CopySlice(arr []int) []int {
	newArr := []int{}
	for i := range arr {
		newArr = append(newArr, arr[i])
	}
	return newArr
}

